var args = WScript.Arguments(0);

var splitparam = args.split(",");
var d= splitparam[0];
var value= splitparam[1];//month/Day
var t= splitparam[2];//type

var splitDate = d.split(".");
var day = splitDate[0];
var month = splitDate[1];
var year = splitDate[2];
var vD = new Date(year,month-1,day);

var vDFinal;
if(t=="m"){
                var sM=vD.getMonth();
                var sMonth=(parseInt(sM)+parseInt(value));
                vD.setMonth(sMonth);

                vDFinal = ((vD.getDate()<10)?("0"+vD.getDate()) : vD.getDate())+"."+ (((vD.getMonth()+1)<10) ? ("0"+(vD.getMonth()+1)) : (vD.getMonth()+1)) +"."+vD.getFullYear();
}
else{
                var sD=vD.getDate();
                var sDate=(parseInt(sD)+parseInt(value));
                vD.setDate(sDate);

                vDFinal = ((vD.getDate()<10)?("0"+vD.getDate()) : vD.getDate())+"."+ (((vD.getMonth()+1)<10) ? ("0"+(vD.getMonth()+1)) : (vD.getMonth()+1)) +"."+vD.getFullYear();
}

WScript.Stdout.WriteLine(vDFinal);
